import { AppBar, Toolbar, Box, Button, Stack } from '@mui/material';


import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';

export default function MyToolbar({ backgroundColor }) {
    const colorHex = backgroundColor;
    return (
        <>
            <Box sx={{ flexGrow: 1, }}>
                <AppBar elevation={0} position="static">
                    <Toolbar sx={{ padding: 1, backgroundColor: colorHex }}>
                        <Stack direction="row" spacing={{ xs: 1, sm: 2, md: 4 }}>
                            <Button
                                sx={{
                                    fontSize: 30,
                                    fontWeight: 'bold',
                                    textTransform: 'none',
                                    color: 'black'
                                }}>
                                Karyna Yen //</Button>

                            <Stack direction="row" spacing={3}>
                                <Button sx={{ color: 'black', }}>Projects</Button>
                                <Button sx={{ color: 'black', }}>Other</Button>
                                <Button sx={{ color: 'black', }}>ContactMe</Button>
                            </Stack>
                        </Stack>


                    </Toolbar>
                </AppBar>
            </Box>
        </>
    );
}
